import './App.css';
import React from 'react'
import nav from './nav';
import {Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div className='App'>

      <Link to='/home'>Home</Link><br/>
        <Link to='/about'>About US</Link><br/>
        <Link to='/blog'>Blog</Link><br/>
        <Link to='/contact'>Contact US</Link><br/>
        <Routes>
        <Route path='/home'element={<Home/>}/>
        <Route path='/about'element={<About/>}/>
        <Route path='/blog'element={<Blog/>}/>
        <Route path='/contact'element={<Con/>}/>
        </Routes>

    </div>
  );
}

function Home()
{
  return(
  <div>
    <h1>Home</h1>
    <p>This is Home Page of website</p>
  </div>
  )
}

function About()
{
  return(
  <div>
    <h1>About US</h1>
    <p>This is About US Page of website</p>
  </div>
  )
}
function Blog()
{
  return(
  <div>
    <h1>Blog</h1>
    <p>This is Blog Page of website</p>
  </div>
  )
}

function Con()
{
  return(
  <div>
    <h1>Contact US</h1>
    <p>This is Contact US of website</p>
  </div>
  )
}


export default App;
